    'В этом разделе, пожалуйста, фиксируйте всю работу по распространению информации об идеях МПУ, которую Вы осуществили путем:'                                                                                                                                                                                                                                                                                                                                                                 => 'У цьому розділі, будь ласка, фіксуйте всю роботу з розповсюдження інформації про ідеї МПУ, яку Ви здійснили шляхом:',
    '1) непосредственного общения с людьми'                                                                                                                                                                                                                                                                                                                                                                                                                                                       => '1) безпосереднього спілкування з людьми',
    '2) распространение брошюр'                                                                                                                                                                                                                                                                                                                                                                                                                                                                   => '2) розповсюдження брошур',
    '3) размещение электронных баннеров на сайтах (своих или друзей, партнеров)'                                                                                                                                                                                                                                                                                                                                                                                                                  => '3) розміщення електронних банерів на веб-сайтах (своїх або друзів, партнерів)',
    '4) публикации материалов о наших идеи интернет-или печатных изданиях'                                                                                                                                                                                                                                                                                                                                                                                                                        => '4) публікації матеріалів про наші ідеї в інтернет- або друкованих виданнях',
    'это и последующее поля включены в Ваш рабочий стол, поскольку Вы вызвались выполнять функции логистического координатора по распространению агитационных материалов В это поле введите количество брошюр, переданных Вам Секретариатом МПУ, и нажмите кнопку "Добавить"'                                                                                                                                                                                                                     => 'це та наступне поля включені до Вашого робочого столу, оскільки Ви зголосились виконувати функції логістичного координатора з розповсюдження агітаційних матеріалів. У це поле введіть кількість брошур, переданих Вам Секретаріатом МПУ, і натисніть кнопку «Додати»',
    'в это поле введите, какое количество полученных брошюр Вы передали местным активистам для распространения, и нажмите кнопку "Добавить"'                                                                                                                                                                                                                                                                                                                                                      => 'у це поле введіть, яку кількість отриманих брошур Ви передали місцевим активістам для розповсюдження, і натисніть кнопку «Додати»',
    'введите, какое количество брошюр Вы лично распространили, и нажмите кнопку "Добавить"'                                                                                                                                                                                                                                                                                                                                                                                                       => 'введіть, яку кількість брошур Ви особисто розповсюдили, і натисніть кнопку «Додати»',
    'В поле «Ссылка» введите ссылку на страницу сайта, где по Вашей помощи был размещен баннер МПУ, в поле «Комментарий» укажите, является ли это Ваш собственный сайт или сайт Ваших друзей / знакомых, как долго баннер сможет там находиться и другую необходимую, по Вашему мнению, информацию.'                                                                                                                                                                                              => 'У поле «Посилання» введіть посилання на сторінку сайту, де за Вашої допомоги був розміщений банер МПУ, у полі «Коментар» зазначте, чи є це Ваш власний сайт або сайт Ваших друзів/знайомих, як довго банер зможе там знаходитись та іншу необхідну, на Вашу думку, інформацію.',
    'Если Вы разместили более одного баннера, нажмите кнопку «Добавить баннер».'                                                                                                                                                                                                                                                                                                                                                                                                                  => 'Якщо Ви розмістили більше одного банера, натисніть кнопку «Додати банер».',
    'Приведите информацию относительно публикаций об идеях меритократии и деятельность нашей команды, которые были осуществлены Вами или с Вашей помощью в интернет-или печатных изданиях.'                                                                                                                                                                                                                                                                                                       => 'Наведіть інформацію щодо публікацій про ідеї мерітократії та діяльність нашої команди, які були здійснені Вами або за Вашою допомогою у інтернет- або друкованих виданнях.',
    'Если таких публикаций было несколько, воспользуйтесь кнопкой «Добавить публикацию».'                                                                                                                                                                                                                                                                                                                                                                                                         => 'Якщо таких публікацій було декілька, скористайтесь кнопкою «Додати публікацію».',
    'В этом разделе размещайте фотографии и комментарии к ним, свидетельствующие о наглядную агитацию, которую Вы осуществляете (авторамки на Ваших авто и авто друзей, в перспективе - баннеры на балконах, фирменные футболки и т.д.).'                                                                                                                                                                                                                                                         => 'У цьому розділі розміщуйте фотографії та коментарі до них, що свідчать про наглядну агітацію, яку Ви здійснюєте (авторамки на Ваших авто та авто друзів, у перспективі – банери на балконах, фірмові футболки і т.д.).',
    'В этом разделе указывайте все рабочие, информационные и другие встречи, мероприятия МПУ и ее местных ячеек (кроме учебных), загруженных или организовали. Например, участие во Второй открытом совещании Оргкомитета МПУ, организация встречи активистов города Львова и т.п.'                                                                                                                                                                                                               => 'У цьому розділі зазначайте усі робочі, інформаційні та інші зустрічі, заходи МПУ та її місцевих осередків (окрім навчальних), які Ви відвідали або організували. Наприклад, участь у Другій відкритій нараді Оргкомітету МПУ, організація зустрічі активістів міста Львова і т.п.',
    'В этом разделе указывайте все общественно-политические мероприятия (кроме учебных), которые Вы организовали или посетили, даже если они не касаются непосредственно деятельности МПУ. Например, общественный мероприятие - Конференция "Регулирование политических партий в Украине: современное состояние и направления реформ", акция общественного активизма - Уборка Парке Партизанской Славы и т.п.'                                                                                    => 'У цьому розділі зазначайте усі громадсько-політичні заходи (окрім навчальних), які Ви організували або відвідали, навіть якщо вони не стосуються безпосередньо діяльності МПУ. Наприклад, громадський захід - Конференція „Регулювання політичних партій в Україні: сучасний стан і напрями реформ”, акція громадського активізму - Прибирання Парку Партизанської Слави і т.п.',
    'В этом разделе указывайте все учебные мероприятия, которые Вы организовали или посетили, в том числе учебные мероприятия МПУ. Например, Тренинг для активистов МПУ, Вебинар по лоббированию, Мастер-класс для общественных активистов и т.п.'                                                                                                                                                                                                                                                => 'У цьому розділі зазначайте усі навчальні заходи, які Ви організували або відвідали, у тому числі навчальні заходи МПУ. Наприклад, Тренінг для активістів МПУ, Вебінар з лобіювання, Майстер-клас для громадських активістів і т.п.',
