    'В этом разделе указывайте все общественно-политические и учебные мероприятия, которые Вы организовали или посетили, даже если они не касаются непосредственно деятельности МПУ. Например, общественный мероприятие - Конференция "Регулирование политических партий в Украине: современное состояние и направления реформ", акция общественного активизма - Уборка Парке Партизанской Славы, учебные мероприятия - Вебинар по лоббированию, Мастер-класс для общественных активистов и т.п.' => 'У цьому розділі зазначайте усі громадсько-політичні та навчальні заходи, які Ви організували або відвідали, навіть якщо вони не стосуються безпосередньо діяльності МПУ. Наприклад, громадський захід - Конференція „Регулювання політичних партій в Україні: сучасний стан і напрями реформ”, акція громадського активізму - Прибирання Парку Партизанської Слави, навчальні заходи - Вебінар з лобіювання, Майстер-клас для громадських активістів і т.п.',
    'Рекомендовал в сеть'                                                                                                                                                                                                                                                                                                                                                                                                                                                                         => 'Рекомендував в мережу',
