    'Информация, отраженная в рабочем столе, является объективным комплексным показателем Вашей активности и эффективности как члена команды. От эффективности вашей работы будет зависеть развитие Вашей партийной карьеры, поэтому оперативно вносите соответствующую информацию в свой рабочий стол.'                                                                                                                                                                                          => 'Інформація, відображена у робочому столі, є обєктивним комплексним показником Вашої активності та ефективності як члена команди. Від ефективності Вашої роботи буде залежати розвиток Вашої партійної кар`єри, тому оперативно вносьте відповідну інформацію у свій робочий стіл.',
