    'Если вы хотите добавить в библиотеку книги, статьи, видео, которые, по Вашему мнению, могут быть полезными для других участников сети, присылайте ссылку на этот материал в интернете или сам файл в адрес secretariat@meritokratia.info. Обратите внимание, что узкоспециализированные материалы лучше размещать в библиотеках соответствующих сообществ. Сделать это могут владельцы или модераторы этих сообществ.'                                                                       => 'Якщо ви хочете додати до бібліотеки книги, статті, відео, які, на Вашу думку, можуть бути корисними для інших учасників мережі, надсилайте лінк на цей матеріал в інтернеті або сам файл на адресу secretariat@meritokratia.info. Зверніть увагу, що вузькоспеціалізовані матеріали краще розміщувати у бібліотеках відповідних спільнот. Зробити це можуть власники або модератори цих спільнот.',
